mapper.select:

select 

from ATMIAC
where ATMIAC_ACTNO = #{atmiacActno,jdbcType=CHAR}
  and ATMIAC_CURCD = #{atmiacCurcd,jdbcType=CHAR}

mapper.delete:

delete from ATMIAC
where ATMIAC_ACTNO = #{atmiacActno,jdbcType=CHAR}
  and ATMIAC_CURCD = #{atmiacCurcd,jdbcType=CHAR}

mapper.update:

update ATMIAC
set ATMIAC_KIND = #{atmiacKind,jdbcType=SMALLINT},
  ATMIAC_RATE_DISC = #{atmiacRateDisc,jdbcType=SMALLINT},
  ATMIAC_FEE_DISC = #{atmiacFeeDisc,jdbcType=SMALLINT},
  UPDATE_USERID = #{updateUserid,jdbcType=INTEGER},
  UPDATE_TIME = #{updateTime,jdbcType=TIMESTAMP}
where ATMIAC_ACTNO = #{atmiacActno,jdbcType=CHAR}
  and ATMIAC_CURCD = #{atmiacCurcd,jdbcType=CHAR}
